import React, {Component} from 'react';
import Navbar from './navbar';
import './App.css';

class App extends Component {
  constructor(){
    super();
    this.state = {};
  }
  render(){
    return(
      <div>
          <Navbar />
          <h1 className="welcome_header">Welcome</h1>
          <p className="welcome_description">Description of what the app does.</p>
      </div>

    );
  }
}

export default App;
